function ImagePopup (props) {
    console.log(props.card);
    if(props.selectedCard=={}){
        props.selectedCard=false;
    }
    else {
        props.selectedCard=true;
    }

    return (
        <div className={`popup popup_type_image ${props.card ? 'popup_is-opened' : ''}`} onClick={props.onClose} >
            <div className="popup__container-image">
                <button type="button" className="popup__close"></button>
                <img src={`${props.card.cardLink}`} alt={`${props.card.cardNAME}`} className="popup__image" />
                <h2 className="popup__image-heading"></h2>
            </div>
        </div>
    );
}

export default ImagePopup;
